package com.kintiger.platform.framework.timer.pojo;

import java.util.Date;

public class WxSendCuruser {
private Long 	 event_dtl_id;
private String	 cur_user_id;
private String	 rtx_code;
private Long 	 event_id;
private Date 	 time;
private String	 cur_sta_id;
private String	 operation;
private String	 initator;
private String	 emp_name;
private String	 model_id;
private String	 event_title;
private String 	wxcode;

public WxSendCuruser() {
	// TODO Auto-generated constructor stub
}
public WxSendCuruser(Long event_dtl_id, String cur_user_id, String rtx_code,
		Long event_id, Date time, String cur_sta_id, String operation,
		String initator, String emp_name, String model_id, String event_title,
		String wxcode) {
	super();
	this.event_dtl_id = event_dtl_id;
	this.cur_user_id = cur_user_id;
	this.rtx_code = rtx_code;
	this.event_id = event_id;
	this.time = time;
	this.cur_sta_id = cur_sta_id;
	this.operation = operation;
	this.initator = initator;
	this.emp_name = emp_name;
	this.model_id = model_id;
	this.event_title = event_title;
	this.wxcode = wxcode;
}
public Long getEvent_dtl_id() {
	return event_dtl_id;
}
public void setEvent_dtl_id(Long event_dtl_id) {
	this.event_dtl_id = event_dtl_id;
}
public String getCur_user_id() {
	return cur_user_id;
}
public void setCur_user_id(String cur_user_id) {
	this.cur_user_id = cur_user_id;
}
public String getRtx_code() {
	return rtx_code;
}
public void setRtx_code(String rtx_code) {
	this.rtx_code = rtx_code;
}
public Long getEvent_id() {
	return event_id;
}
public void setEvent_id(Long event_id) {
	this.event_id = event_id;
}
public Date getTime() {
	return time;
}
public void setTime(Date time) {
	this.time = time;
}
public String getCur_sta_id() {
	return cur_sta_id;
}
public void setCur_sta_id(String cur_sta_id) {
	this.cur_sta_id = cur_sta_id;
}
public String getOperation() {
	return operation;
}
public void setOperation(String operation) {
	this.operation = operation;
}
public String getInitator() {
	return initator;
}
public void setInitator(String initator) {
	this.initator = initator;
}
public String getEmp_name() {
	return emp_name;
}
public void setEmp_name(String emp_name) {
	this.emp_name = emp_name;
}
public String getModel_id() {
	return model_id;
}
public void setModel_id(String model_id) {
	this.model_id = model_id;
}
public String getEvent_title() {
	return event_title;
}
public void setEvent_title(String event_title) {
	this.event_title = event_title;
}
public String getWxcode() {
	return wxcode;
}
public void setWxcode(String wxcode) {
	this.wxcode = wxcode;
}
@Override
public String toString() {
	return "WxSendCuruser [event_dtl_id=" + event_dtl_id + ", cur_user_id="
			+ cur_user_id + ", rtx_code=" + rtx_code + ", event_id=" + event_id
			+ ", time=" + time + ", cur_sta_id=" + cur_sta_id + ", operation="
			+ operation + ", initator=" + initator + ", emp_name=" + emp_name
			+ ", model_id=" + model_id + ", event_title=" + event_title
			+ ", wxcode=" + wxcode + "]";
}

}
